class SvgIcon extends React.Component {
  constructor(props) {
    super(props);
  }
  
  render() {

    var getWidth = function(viewBox) {
      return viewBox.split(' ')[2];
    }
    
    var getHeight = function(viewBox) {
      return viewBox.split(' ')[3];
    }

    var svgIconName = SvgIcons[this.props.iconName].name;
    var svgIconViewbox = SvgIcons[this.props.iconName].viewBox;
    var svgIconWidth = getWidth(SvgIcons[this.props.iconName].viewBox);
    var svgIconHeight = getHeight(SvgIcons[this.props.iconName].viewBox);
    var svgIconContent = "<style>.svgIcon-"+svgIconName+"{width:"+(svgIconWidth/16)+"rem;height:"+(svgIconHeight/16)+"rem;}</style>" + SvgIcons[this.props.iconName].data;

    //this object is also in styleguide page icons        
    return(
      <svg 
        className={"svgIcon " + "svgIcon-"+svgIconName}
        viewBox={svgIconViewbox} 
        width={svgIconWidth + "px"}
        height={svgIconHeight + "px"}
        aria-hidden="true"
        dangerouslySetInnerHTML={{__html: svgIconContent}}
        focusable="false">
      </svg>
    );
  }
}

export {SvgIcons, SvgIcon};